import React from "react";
import { Link } from "react-router-dom";
import { APP_ROUTES } from "../../constants/app-bar.constans"

export function AppBar() {
    function renderLinks({route, title}:any, index: number) {
        console.log(route, index)
        return (
            <li key={index}>
                <Link to={route}>
                    {title}
                </Link>
            </li>
        )
    }


    return (
        <div>
            <ul>
                {APP_ROUTES.map(renderLinks)}
            </ul>
        </div>
    )
}
